import React , { useEffect, useReducer, useState }from "react";
import "./Login.css" ;

function Login() {
    const[id , setid]=useState();

    return ( 
    <div className="Login">


    <input type='text' name="id"></input>

    <input type='password' name="password" ></input>
    </div>
    );
};
export default Login;
